import React, { useState } from 'react';
import { Form, Input, Button, message } from 'antd';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';


const LoginForm = () => {
    
    const navigate = useNavigate();

  const [loading, setLoading] = useState(false);

  const onFinish = async (values) => {
    setLoading(true);
    try {
      const response = await axios.post('http://localhost:8000/login/loginPage', values);
      console.log(response.data); // Manejar la respuesta del backend
      message.success('Inicio de sesión exitoso');
    //   navigate("/Login")
      // Aquí podrías manejar la sesión en el frontend si fuera necesario
    } catch (error) {
      message.error(error.response?.data?.error || 'Error en el inicio de sesión');
    } finally {
      setLoading(false);
    }
  };


  return (
    <Form
      name="login-form"
      initialValues={{ remember: true }}
      onFinish={onFinish}
      style={{ maxWidth: 300 }}
    >
      <Form.Item
        name="Correo_Electronico"
        rules={[{ required: true, message: 'Por favor ingresa tu correo electrónico' }]}
      >
        <Input placeholder="Correo electrónico" />
      </Form.Item>

      <Form.Item
        name="Contrasena"
        rules={[{ required: true, message: 'Por favor ingresa tu nombre de usuario' }]}
      >
        <Input placeholder="Nombre de usuario" />
      </Form.Item>

      <Form.Item>
        <Button type="primary" htmlType="submit" loading={loading} block>
          Iniciar sesión
        </Button>
      </Form.Item>
    </Form>
  );
};

export default LoginForm;
